from sympy import sieve
def dmo(n, t):
    if t < n: return False
    while n and t:
        if n%10 == t%10:
            n //= 10
        t //= 10
    return n == 0
def a(n):
    return next(p for p in sieve if dmo(n, p))
print([a(n) for n in range(1, 77)]) # _Michael S. Branicky_, Jan 21 2023

